const product = $json;

const prompt = `You are a ROCKSTAR Digital Marketing Expert and Market Researcher with 20+ years of experience in e-commerce optimization and pricing strategy. Analyze this WooCommerce product and provide a comprehensive evaluation report.

## PRODUCT DATA:
- **Name:** ${product.productName}
- **Description:** ${product.productDescription}
- **Short Description:** ${product.productShortDescription}
- **Current Price:** $${product.productPrice}
- **Regular Price:** $${product.productRegularPrice}
- **Sale Price:** ${product.productSalePrice ? '$' + product.productSalePrice : 'N/A'}
- **Categories:** ${product.productCategories}
- **Tags:** ${product.productTags}
- **Status:** ${product.productStatus}
- **Stock:** ${product.productStock}
- **Total Sales:** ${product.totalSales}
- **Average Rating:** ${product.averageRating}/5 (${product.ratingCount} reviews)
- **Variation Statistics:** 

## EVALUATION CRITERIA:
Analyze and score each area from 1-10, then provide specific actionable improvements.

## PRICING ANALYSIS (IMPORTANT):
- Compare the current price against market standards for similar products
- Determine if the price is CHEAP, FAIR, or EXPENSIVE
- Provide a suggested optimal retail price based on:
  - Product category standards
  - Perceived value
  - Competition
  - Target market purchasing power
- Use the variation statistics to determine if the product is profittable atleast 15%.

## REQUIRED OUTPUT FORMAT (JSON):
{
  "overallScore": <1-10>,
  "marketabilityScore": <1-10>,
  "isMarketable": <true/false>,
  "verdict": "<EXCELLENT/GOOD/NEEDS IMPROVEMENT/POOR>",
  "summary": "<2-3 sentence executive summary>",
  "scores": {
    "productName": <1-10>,
    "description": <1-10>,
    "pricing": <1-10>,
    "categoryOptimization": <1-10>,
    "seoReadiness": <1-10>
  },
  "pricingAnalysis": {
    "currentPrice": <current price as number>,
    "priceVerdict": "<CHEAP/FAIR/EXPENSIVE>",
    "suggestedRetailPrice": <suggested price as number>,
    "priceJustification": "<why this price is recommended>",
    "competitorPriceRange": "<estimated competitor price range>",
    "profitPotential": "<HIGH/MEDIUM/LOW>",
    "pricingStrategy": "<recommended pricing strategy>"
  },
  "improvements": {
    "productName": {
      "currentIssues": "<issues with current name>",
      "suggestedName": "<improved product name>",
      "reasoning": "<why this is better>"
    },
    "description": {
      "currentIssues": "<issues with current description>",
      "suggestedDescription": "<improved 2-3 paragraph description>",
      "keyBenefitsToHighlight": ["<benefit1>", "<benefit2>", "<benefit3>"]
    },
    "shortDescription": {
      "suggestedShortDescription": "<compelling 1-2 sentence hook>"
    }
  },
  "targetAudience": "<ideal customer profile>",
  "marketingAngles": ["<angle1>", "<angle2>", "<angle3>"]
}

Respond ONLY with valid JSON, no markdown or extra text.`;

return {
  requestBody: {
    contents: [{
      parts: [{
        text: prompt
      }]
    }],
    generationConfig: {
      temperature: 0.7,
      maxOutputTokens: 4096
    }
  },
  productData: product
};

const response = $json;
const productData = $('Prepare Evaluation Prompt').item.json.productData;

let text = '';
try {
  text = response.candidates?.[0]?.content?.parts?.[0]?.text || '';
} catch (e) {
  text = '';
}

if (!text) {
  return null;
}

let evaluation;
try {
  const jsonMatch = text.match(/\{[\s\S]*\}/);
  if (jsonMatch) {
    evaluation = JSON.parse(jsonMatch[0]);
  } else {
    return null;
  }
} catch (e) {
  return null;
}

// Return flat object with all fields including pricing
return {
  EvaluatedAt: new Date().toISOString().split('T')[0],
  ProductID: String(productData.productId),
  ProductName: String(productData.productName || ''),
  CurrentPrice: String(productData.productPrice || ''),
  OverallScore: String(evaluation.overallScore || ''),
  Verdict: String(evaluation.verdict || ''),
  Summary: String(evaluation.summary || '').substring(0, 500),

  // Pricing Analysis
  PriceVerdict: String(evaluation.pricingAnalysis?.priceVerdict || ''),
  SuggestedRetailPrice: String(evaluation.pricingAnalysis?.suggestedRetailPrice || ''),
  PriceJustification: String(evaluation.pricingAnalysis?.priceJustification || ''),
  CompetitorPriceRange: String(evaluation.pricingAnalysis?.competitorPriceRange || ''),
  ProfitPotential: String(evaluation.pricingAnalysis?.profitPotential || ''),
  PricingStrategy: String(evaluation.pricingAnalysis?.pricingStrategy || ''),

  // Other fields
  SuggestedName: String(evaluation.improvements?.productName?.suggestedName || ''),
  SuggestedDesc: String(evaluation.improvements?.shortDescription?.suggestedShortDescription || ''),
  TargetAudience: String(evaluation.targetAudience || '')
};
